import { useState} from "react";
import { toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import InputMask from 'react-input-mask';
import '../register/style.css';
import Button from '../../components/utils/button/button';
import Api from "../../services/api";
import {} from 'formik';
toast.configure();

export default function Register() {

  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [crm, setCrm] = useState('');
  const [cpf, setCpf] = useState('');
  const [phone, setPhone] = useState('');
  const [specialization, setSpecialization] = useState('');
  
  

  
  async function submitOn(e) {
    
    e.preventDefault();
    const data = {
      name: name,
      email: email,
      password: password,
      crm: crm,
      cpf: cpf,
      phone: phone,
      specialization: specialization
    }
    try {
      if(name!==''&&email!==''&&password!==''&&crm!==''&&phone!==''&&specialization!==''){ 
          
        
        
        
        const response = await Api.post('verifyUser',data)
        if(response.status === 201){
          sessionStorage.setItem('user',JSON.stringify(data));
          window.location.href= '/confirmation';
        }
      }else{
        alert("Fill in all data")
      }
    
    } catch (error) {
      const { data } = error.response;
      alert(data.message);
      
    }
        
      
    
}
function onblurCrm(e){

  const {value} = e.target;

  if(value === ''){
    return;
  }
  fetch(`https://www.consultacrm.com.br/api/index.php?tipo=crm&uf=am&q=${value}&chave=2798018964&destino=json`)
  .then((res) => res.json())
  .then((data) =>console.log(data.item))
  
}
return (
  <div className="App">
    <Formik
      onSubmit={onSubmit}
      validateOnMount
      initialValues={{
        cep: '',
        logradouro: '',
        numero: '',
        complemento: '',
        bairro: '',
        cidade: '',
        uf: '',
      }}
      render={({ isValid, setFieldValue }) => (
        <Form>
          <div className="form-control-group">
            <label>Cep</label>
            <Field name="cep" type="text" onBlur={(ev) => onBlurCep(ev, setFieldValue)} />
          </div>
          <div className="form-control-group">
            <label>Logradouro</label>
            <Field name="logradouro" type="text" />
          </div>
          <div className="form-control-group">
            <label>Número</label>
            <Field name="numero" type="text" />
          </div>
          <div className="form-control-group">
            <label>Complemento</label>
            <Field name="complemento" type="text" />
          </div>
          <div className="form-control-group">
            <label>bairro</label>
            <Field name="bairro" type="text" />
          </div>
          <div className="form-control-group">
            <label>Cidade</label>
            <Field name="cidade" type="text" />
          </div>
          <div className="form-control-group">
            <label>Estado</label>
            <Field component="select" name="uf">
              <option value={null}>Selecione o Estado</option>
              <option value="SP">São Paulo</option>
              <option value="SC">Santa Catarina</option>
            </Field>
          </div>
          <button type="submit" disabled={!isValid}>Enviar</button>
        </Form>
      )}
    />
  </div>
);
}
